import React, {Component} from "react";
import ReactDOM from "react-dom";
import dates from "../tours.json";


class TourTable extends React.Component {


	  constructor(props) {
    super(props); // Must call
    this.state = {
        dates: dates,
        Date: "",
        Name: "",
	}
	 this.TableHeader = this.TableHeader.bind(this);
	 this.TableData = this.TableData.bind(this);

  }



 addNewName(element){
        this.setState({
            Name: element.target.value
        })
    }

 addNewDate(element){
        this.setState({
            Date: element.target.value
        })
    }

 addNewTour() {
 const copyTours = Object.assign([],this.state.dates);
 console.log('copyTours ',copyTours);
	 copyTours.push({
      Name: this.state.Name,
      Date: this.state.Date
        })
   this.setState({dates: copyTours});
    }


delChoice(i) {
  let upChoices = this.state.dates.filter(function(place, index){
    if(index === i)
      return false;
    else
      return true;
  })
  this.setState({dates: upChoices});
}


TableHeader() {
      let header = Object.keys(this.state.dates[0])
      return header.map((key, index) => {
         return <th className="th" key={index}>{key.toUpperCase()}</th>
      })
   }



 TableData() {
	  let that = this;
      return this.state.dates.map((place, index) => {
         return (
            <tr>
               <td><button className = "b" onClick={that.delChoice.bind(that, index)}>Delete</button></td>
               <td>{place.Name}</td>
			   <td>{place.Date}</td>
            </tr>
         )
      })
   }




  render(){
  return (
	  <div className = "TableHead">
	  <div >
	  <p> Add Tour </p>
	  <label>Name</label>
	  &nbsp;&nbsp;&nbsp;<input type="text" name="name" onChange= {this.addNewName.bind(this)}/><br/>
	  <label>Date</label>
	  &nbsp;&nbsp;&nbsp;<input type="text" name="date" onChange= {this.addNewDate.bind(this)}/><br/>
	  <button className = "btn" onClick={this.addNewTour.bind(this)}>Add</button>

	  </div>
	   	<h3>Whale Watching Tours :</h3>
      	<table>
     <thead>

     	{this.TableHeader()}
      </thead>
	  <tbody>
      {this.TableData()}
      </tbody>
      </table>
	  </div>
  );
}

}
export default TourTable;
